      <h2 style="color: black;">Zachary Branson</h2>
      <div class="profile"></div>
      <p>
      I am 24 years old, and currently a senior at Stephen F. Austin State
      University seeking a Bachelor of Science in Computer Science. I have
      been married to my wife Danica, and we are currently expecting our
      first child. I am a hard-working, detailed programmer, excited and
      ready to use the skills learned throughout my degree in a professional
      environment.


      </p>
      <p>
        I am disciplined and driven in the numerous skills
        I have developed and seek to gain more knowledge
        in other venues that are available to me as a
        software developer.

      </p>
      <p>
        I look forward to meeting with you and learning how I might be a part of your organization.
      </p>

